issue.body:
## The problem

>Currently, we are relying on a globally (per application container) event-aggregator to handle the communication.

It's typically used in 2 places:
* Subscription
  ```ts
  this.eventAggregator.subscribe('Network.Changed.Connected', (info: IChainEventInfo): void => {
    networkChange(info);
  });
  ```
* Publish
  ```ts
  private fireConnectHandler(info: IChainEventInfo): void {
    this.logger.info(`connected: ${info.chainName ?? 'undefined'}`);
    this.eventAggregator.publish('Network.Changed.Connected', info);
  }
  ```

This works, though notice when we type `this.eventAggregator.subscribe('` or `this.eventAggregator.publish('`, there will be no intellisense support, so we will have to figure out the event name ourselves, and also this is very prone to typo. Another cons of doing it this way is almost zero discoverability. It's harder to understand the codebase on a higher level for something so crucial, since it's used mainly for the core services & store to communicate.

## The solution

Having a separate interface to describe possible publish/subscribe overrides for better intellisense:
```ts
interface IKCommunicator {
  subscribe(type: 'Network.Changed.Connected', callback: (info: IChainEventInfo) => void): IDisposable;
  publish(type: 'Network.Changed.Connected', info: IChainEventInfo): void;

  ... etc for all other events
}
```

> Note that this can still be the same global IEventAggregator object, we just specify different injection token and interface for the object injected.

Then we can easily group all the important data/state communication together to organise and further improve the design of our application. A bonus is it helps us understand the Eth service better for a potential refactoring/test improvement

`npm run test` silently fails intermittently running on Doug's machine in both PowerShell and GitBash.

It fails in the most simple case when you replace the tests in contracts-service.spec with this single test:

```
describe('simple example', () => {
  it('sleeps for 10 seconds', () => {
    return new Promise((resolve: (args: unknown[]) => void): unknown => setTimeout(resolve, 10000)).then(() => expect(true));
  });
});
```
